            this._drawStatus+=(this.status-this._drawStatus)/5;
            var s=ig.system.scale;
            var w=ig.system.width*0.6;
            var h=ig.system.height*0.1;
            var x=ig.system.width*0.5-w/2;
            var y=ig.system.height*0.5-h/2;
