            ig.system.context.fillRect(0,0,480,320);
            ig.system.context.fillStyle='#fff';
            ig.system.context.fillRect(x*s,y*s,w*s,h*s);
            ig.system.context.fillStyle='#000';
            ig.system.context.fillRect(x*s+s,y*s+s,w*s-s-s,h*s-s-s);
