ig.baked=true;
ig.module('game.entities.player').requires('impact.entity').defines(function(){
    EntityPlayer=ig.Entity.extend({
        sfxSnap:new ig.Sound('media/sounds/knips.*'),
        sfxMagic:new ig.Sound('media/sounds/Switch.*'),
        sfxHit:new ig.Sound('media/sounds/Hit.*'),
        size:{
            x:14,
            y:48
        },
        offset:{
            x:17,
            y:2
        },
        maxVel:{
            x:60,
            y:120
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:120,
        gravityFactor:20,
        snapping:false,
        state:'big',
        newPlayer:true,
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.PASSIVE,
        animSheet:new ig.AnimationSheet('media/magician.png',48,48),
        flip:true,
        accelGround:230,
        accelAir:200,
        jump:500,
        active:true,
        hp:3,
        init:function(x,y,settings){
            this.parent(x,y,settings);
            if(this.silhouette){
                this.animSheet=new ig.AnimationSheet('media/magician_silhouette.png',48,48);
            }
            this.addAnim('idle',1,[0]);
            this.addAnim('walk',0.15,[1,2,3,4,5,6,7,8]);
            this.addAnim('jump',0.1,[14,15],true);
            this.addAnim('fall',0.1,[16,17],true);
            this.addAnim('hit',0.1,[18,19,20,21],true);
            this.addAnim('snap',0.05,[11,10,9,11],true);
            this.addAnim('invisible',1,[18]);
            this.invincibleTimer=new ig.Timer(0);
        },
        hit:function(damage){
            if(this.invincibleTimer.delta()>0){
                this.hp-=damage;
                this.wasHit=true;
                this.hitTimer=new ig.Timer(0.6);
                this.invincibleTimer=new ig.Timer(3);
                this.vel.x=this.accel.x=0;
                this.anims.hit.rewind();
                this.sfxHit.play();
                if(this.hp<=0){
                    ig.game.fadeDead();
                }
            }
        },
        goIntoCloset:function(x){
            this.invisible=true;
            this.vel.x=this.accel.x=this.vel.y=this.accel.y=0;
            this.pos.x=x-this.size.x/2;
        },
        goOutOfCloset:function(size){
            if(size==='big'){
                this.invisible=false;
            }else if(size==='medium'){
                this.kill();
                ig.game.switchPlayer(size,this.pos.x,this.pos.y+16);
            }else if(size==='small'){
                this.kill();
                ig.game.switchPlayer(size,this.pos.x,this.pos.y+30);
            }
        },
        snap:function(){
            this.vel.x=0;
            this.accel.x=0;
            this.snapping=true;
            this.snapTimer=new ig.Timer(0.5);
            this.currentAnim=this.anims.snap;
            this.currentAnim.flip.x=this.flip;
            this.currentAnim.rewind();
            this.sfxSnap.play();
            this.sfxMagic.play();
        },
        stop:function(){
            this.active=false;
            TweenMax.to(this.accel,0.5,{
                x:0
            });
        },
        update:function(){
            this.newPlayer=false;
            var accel=this.standing?this.accelGround:this.accelAir;
            if(this.active&&!this.snapping&&!this.invisible){
                if(ig.input.state('left')){
                    if(this.vel.x>0){
                        this.accel.x=-(accel*4);
                    }else{
                        this.accel.x=-accel;
                    }
                    this.flip=true;
                }else if(ig.input.state('right')){
                    if(this.vel.x<0){
                        this.accel.x=accel*4
                        }else{
                        this.accel.x=accel;
                    }
                    this.flip=false;
                }else{
                    this.accel.x=0;
                }
            }
            if(this.standing&&ig.input.pressed('jump')&&!this.invisible){
                this.vel.y=-this.jump;
                this.anims.jump.rewind();
                this.anims.fall.rewind();
                this.falling=false;
            }
            if((this.vel.x>0&&this.standing)||(this.vel.x<0&&this.standing)){
                this.currentAnim=this.anims.walk;
            }else if(!this.standing&&this.vel.y>0){
                if(this.falling===false){
                    this.anims.fall.rewind();
                    this.falling=true;
                }
                this.currentAnim=this.anims.fall;
            }else if(!this.standing){
                this.currentAnim=this.anims.jump;
            }
            else{
                this.currentAnim=this.anims.idle;
            }
            if(this.snapping){
                this.currentAnim=this.anims.snap;
                if(this.snapTimer.delta()>0){
                    this.snapping=false;
                }
            }
            if(this.wasHit){
                this.currentAnim=this.anims.hit;
                if(this.hitTimer.delta()>0){
                    this.wasHit=false;
                }
            }
            if(this.invisible){
                this.currentAnim=this.anims.invisible;
            }
            if(this.invincibleTimer.delta()<0){
                if(this.currentAnim.alpha===1){
                    this.currentAnim.alpha=0;
                }else{
                    this.currentAnim.alpha=1;
                }
            }else{
                this.currentAnim.alpha=1;
            }
            this.currentAnim.flip.x=this.flip;
            this.parent();
        }
    });
});

