ig.baked=true;
ig.module('game.entities.doorBig').requires('impact.entity','game.entities.selectable','game.entities.box','game.entities.doorMedium','game.entities.doorSmall').defines(function(){
    EntityDoorBig=EntitySelectable.extend({
        size:{
            x:48,
            y:48
        },
        offset:{
            x:0,
            y:23
        },
        maxVel:{
            x:80,
            y:80
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:100,
        gravityFactor:10,
        state:'big',
        faded:false,
        locked:false,
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NONE,
        animSheet:new ig.AnimationSheet('media/door48.png',48,64),
        flip:false,
        isMouseOverMe:function(){
            if(ig.input.mouse.x+ig.game.screen.x>=this.pos.x&&ig.input.mouse.x+ig.game.screen.x<=this.pos.x+this.size.x&&ig.input.mouse.y+ig.game.screen.y>=this.pos.y-this.offset.y&&ig.input.mouse.y+ig.game.screen.y<=this.pos.y+this.size.y-this.offset.y){
                return true;
            }
            return false;
        },
        check:function(other){
            if(other===ig.game.player&&!this.faded&&this.state===ig.game.player.state){
                if((this.locked&&ig.game.keys>0)||!this.locked){
                    ig.game.fade();
                    ig.game.player.stop();
                    this.faded=true;
                }else{
                    ig.game.say('locked');
                }
            }else if(other===ig.game.player&&ig.game.player.state!==this.state){
                ig.game.say('wrong size');
            }
        },
        init:function(x,y,settings){
            if(ig.editor===undefined){
                ig.game.sortEntitiesDeferred();
            }
            this.parent(x,y,settings);
            var base=0;
            if(this.locked){
                base=4;
            }
            this.addAnim('idle',1,[base]);
            this.addAnim('selected',1,[base+1]);
            this.addAnim('growing',0.1,[3,2],true);
            this.addAnim('shrinking',0.1,[2,3],true);
            this.currentAnim=this.anims.idle;
            if(this.lastSize==='small'||this.lastSize==='medium'){
                this.growing=true;
                this.shrinkTimer=new ig.Timer(0.25);
                this.currentAnim=this.anims.growing;
                this.currentAnim.rewind();
            }
        },
        switchSize:function(size){
            if(size==='small'||size==='medium'){
                this.switching=this.shrinking=true;
                this.shrinkTimer=new ig.Timer(0.24);
                this.currentAnim=this.anims.shrinking;
                this.currentAnim.rewind();
                this.newSize=size;
            }
        },
        spawnNewEntities:function(size){
            if(size==='small'){
                ig.game.spawnEntity(EntityDoorSmall,this.pos.x+18,this.pos.y+36,{
                    locked:this.locked
                    });
                this.kill();
            }else if(size==='medium'){
                ig.game.spawnEntity(EntityDoorMedium,this.pos.x+8,this.pos.y+20,{
                    locked:this.locked
                    });
                this.kill();
            }
        }
    });
});

