ig.baked=true;
ig.module('game.entities.pictureBig').requires('impact.entity','game.entities.selectable','game.entities.box').defines(function(){
    EntityPictureBig=EntitySelectable.extend({
        size:{
            x:48,
            y:48
        },
        offset:{
            x:0,
            y:9
        },
        maxVel:{
            x:80,
            y:150
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:90,
        gravityFactor:0,
        state:'big',
        tileset:0,
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.NONE,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/pictureBig.png',56,56),
        flip:false,
        init:function(x,y,settings){
            if(ig.editor===undefined){
                ig.game.sortEntitiesDeferred();
            }
            this.parent(x,y,settings);
            if(this.tileset===2){
                this.baseTile=5;
            }
            this.addAnim('idle',1,[this.baseTile]);
            this.addAnim('selected',1,[this.baseTile+1]);
            this.addAnim('shrinking',0.1,[2,3,4],true);
            this.addAnim('growing',0.1,[4,3,2],true);
            this.currentAnim=this.anims.idle;
            if(this.lastSize==='small'||this.lastSize==='medium'){
                this.growing=true;
                this.shrinkTimer=new ig.Timer(0.35);
                this.currentAnim=this.anims.growing;
                this.currentAnim.rewind();
            }
        },
        switchSize:function(size){
            if(size==='small'||size==='medium'){
                this.switching=this.shrinking=true;
                this.shrinkTimer=new ig.Timer(0.35);
                this.currentAnim=this.anims.shrinking;
                this.currentAnim.rewind();
                this.newSize=size;
            }
        },
        spawnNewEntities:function(size){
            if(size==='small'){
                ig.game.spawnEntity(EntityPictureSmall,this.pos.x+18,this.pos.y+36,{
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }else if(size==='medium'){
                ig.game.spawnEntity(EntityPictureMedium,this.pos.x+8,this.pos.y+20,{
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }
        }
    });
});

