// lib/game/entities/thunder.js
ig.baked=true;
ig.module('game.entities.thunder').requires('impact.entity').defines(function(){
    EntityThunder=ig.Entity.extend({
        size:{
            x:64,
            y:64
        },
        zIndex:-650,
        gravityFactor:0,
        thundering:false,
        type:ig.Entity.TYPE.NONE,
        checkAgainst:ig.Entity.TYPE.NONE,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/logo.png',64,64),
        init:function(x,y,settings){
            this.parent(x,y,settings);
            this.thunderTimer=new ig.Timer(1);
            this.rainTimer=new ig.Timer(0);
            this.addAnim('idle',1,[1]);
        },
        update:function(){
            if(this.thunderTimer.delta()>0&&!this.thundering){
                ig.game.thunder();
                this.thundering=true;
                this.durationTimer=new ig.Timer(1*Math.random());
            }else if(this.thundering&&this.durationTimer.delta()>0){
                this.thundering=false;
                this.thunderTimer=new ig.Timer(5*Math.random());
            }
            if(this.rainTimer.delta()>0){
                ig.game.spawnSmallRain();
                this.rainTimer.set(0.5);
            }
            this.parent();
        }
    });
});

// lib/game/entities/deathTrigger.js
ig.baked=true;
ig.module('game.entities.deathTrigger').requires('impact.entity').defines(function(){
    EntityDeathTrigger=ig.Entity.extend({
        size:{
            x:16,
            y:16
        },
        _wmScalable:true,
        _wmDrawBox:true,
        _wmBoxColor:'rgba(196, 255, 0, 0.7)',
        type:ig.Entity.TYPE.NONE,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NEVER,
        init:function(x,y,settings){
            this.parent(x,y,settings);
        },
        check:function(other){
            if(other===ig.game.player&&!this.faded){
                ig.game.fadeDead();
                this.faded=true;
            }
        },
        update:function(){}
    });
});

