// lib/game/entities/closetSmall.js
ig.baked=true;
ig.module('game.entities.closetSmall').requires('impact.entity','game.entities.selectable','game.entities.box').defines(function(){
    EntityClosetSmall=EntitySelectable.extend({
        size:{
            x:12,
            y:12
        },
        offset:{
            x:0,
            y:5
        },
        maxVel:{
            x:80,
            y:150
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:100,
        gravityFactor:10,
        state:'small',
        tileset:2,
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/closetSmall.png',16,16),
        flip:false,
        init:function(x,y,settings){
            if(ig.editor===undefined){
                ig.game.sortEntitiesDeferred();
            }
            this.parent(x,y,settings);
            if(this.silhouette){
                this.animSheet=new ig.AnimationSheet('media/crate12_silhouette.png',16,16);
            }
            this.addAnim('idle',1,[this.baseTile]);
            this.addAnim('selected',1,[this.baseTile+1]);
            this.addAnim('closing',0.1,[8,9,10,11,13,14,14],true);
            this.addAnim('opening',0.1,[16,17,18,19,20,21,22,22],true);
            this.currentAnim=this.anims.idle;
        },
        check:function(other){
            if(other===ig.game.player){
                if(other.state===this.state){
                    ig.game.say('pressDown');
                }
                if(ig.input.pressed('down')&&!other.newPlayer&&!this.closing&&!this.opening){
                    this.activateCloset();
                }
            }
        },
        activateCloset:function(){
            if(!this.closing){
                if(!this.activated&&ig.game.player.state===this.state){
                    ig.game.sfxCreak.play();
                    ig.game.player.goIntoCloset(this.pos.x+this.size.x/2);
                    this.activated=!this.activated;
                    this.closing=true;
                    this.activateTimer=new ig.Timer(0.75);
                    this.anims.closing.rewind();
                }else if(!this.activated&&ig.game.player.state!==this.state){
                    ig.game.say('wrong size');
                }else{
                    ig.game.sfxCreak.play();
                    this.activated=!this.activated;
                    this.opening=true;
                    this.activateTimer=new ig.Timer(0.85);
                    this.anims.opening.rewind();
                }
            }
        },
        isMouseOverMe:function(){
            if(ig.input.mouse.x+ig.game.screen.x>=this.pos.x-this.size.x&&ig.input.mouse.x+ig.game.screen.x<=this.pos.x+this.size.x*2&&ig.input.mouse.y+ig.game.screen.y>=this.pos.y-this.size.y&&ig.input.mouse.y+ig.game.screen.y<=this.pos.y+this.size.y*2){
                return true;
            }
            return false;
        },
        switchSize:function(size){
            if(size==='big'){
                ig.game.spawnEntity(EntityClosetBig,this.pos.x-18,this.pos.y-36,{
                    activated:this.activated,
                    lastSize:'small',
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }else if(size==='medium'){
                ig.game.spawnEntity(EntityClosetMedium,this.pos.x-10,this.pos.y-20,{
                    activated:this.activated,
                    lastSize:'small',
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }
        }
    });
});

