// lib/game/entities/closetMedium.js
ig.baked=true;
ig.module('game.entities.closetMedium').requires('impact.entity','game.entities.selectable','game.entities.box').defines(function(){
    EntityClosetMedium=EntitySelectable.extend({
        size:{
            x:32,
            y:32
        },
        offset:{
            x:0,
            y:9
        },
        maxVel:{
            x:80,
            y:150
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:100,
        gravityFactor:10,
        state:'medium',
        tileset:0,
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/closetMedium.png',40,40),
        flip:false,
        init:function(x,y,settings){
            if(ig.editor===undefined){
                ig.game.sortEntitiesDeferred();
            }
            this.parent(x,y,settings);
            if(this.tileset===2){
                this.baseTile=5;
            }
            if(this.silhouette){
                this.animSheet=new ig.AnimationSheet('media/crate32_silhouette.png',40,40);
            }
            this.addAnim('idle',1,[this.baseTile]);
            this.addAnim('selected',1,[this.baseTile+1]);
            this.addAnim('shrinking',0.1,[2,3,4],true);
            this.addAnim('growing',0.1,[4,3,2],true);
            this.addAnim('closing',0.1,[8,9,10,11,13,14,14],true);
            this.addAnim('opening',0.1,[16,17,18,19,20,21,22,22],true);
            this.currentAnim=this.anims.idle;
            if(this.lastSize==='small'){
                this.growing=true;
                this.shrinkTimer=new ig.Timer(0.35);
                this.currentAnim=this.anims.growing;
                this.currentAnim.rewind();
            }
        },
        check:function(other){
            if(other===ig.game.player){
                if(!other.invisible){
                    if(other.state===this.state){
                        ig.game.say('pressDown');
                    }
                }
                if(ig.input.pressed('down')&&!other.newPlayer&&!this.closing&&!this.opening){
                    this.activateCloset();
                }
            }
        },
        activateCloset:function(){
            if(!this.closing){
                if(!this.activated&&ig.game.player.state===this.state){
                    ig.game.sfxCreak.play();
                    ig.game.player.goIntoCloset(this.pos.x+this.size.x/2);
                    this.activated=!this.activated;
                    this.closing=true;
                    this.activateTimer=new ig.Timer(0.75);
                    this.anims.closing.rewind();
                }else if(!this.activated&&ig.game.player.state!==this.state){
                    ig.game.say('wrong size');
                }else{
                    ig.game.sfxCreak.play();
                    this.activated=!this.activated;
                    this.opening=true;
                    this.activateTimer=new ig.Timer(0.85);
                    this.anims.opening.rewind();
                }
            }
        },
        switchSize:function(size){
            if(size==='small'){
                this.switching=this.shrinking=true;
                this.shrinkTimer=new ig.Timer(0.35);
                this.currentAnim=this.anims.shrinking;
                this.currentAnim.rewind();
                this.newSize=size;
            }else if(size==='big'){
                ig.game.spawnEntity(EntityClosetBig,this.pos.x-8,this.pos.y-16,{
                    activated:this.activated,
                    lastSize:'medium',
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }
        },
        spawnNewEntities:function(size){
            if(size==='small'){
                ig.game.spawnEntity(EntityClosetSmall,this.pos.x+10,this.pos.y+20,{
                    activated:this.activated,
                    lastSize:'medium',
                    tileset:this.tileset,
                    silhouette:this.silhouette
                    });
                this.kill();
            }
        }
    });
});

