ig.module('game.entities.keySmall').requires('impact.entity','game.entities.selectable','game.entities.box','game.entities.keyBig','game.entities.keyMedium').defines(function(){
    EntityKeySmall=EntitySelectable.extend({
        sfxPickup:new ig.Sound('media/sounds/LBM_cue2.*'),
        size:{
            x:12,
            y:12
        },
        offset:{
            x:0,
            y:3
        },
        maxVel:{
            x:80,
            y:80
        },
        friction:{
            x:600,
            y:0
        },
        zIndex:100,
        gravityFactor:10,
        state:'small',
        type:ig.Entity.TYPE.A,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NONE,
        animSheet:new ig.AnimationSheet('media/key12.png',12,12),
        flip:false,
        init:function(x,y,settings){
            if(ig.editor===undefined){
                ig.game.sortEntitiesDeferred();
            }
            this.parent(x,y,settings);
            if(this.dropped){
                this.dropTimer=new ig.Timer(1.5);
            }else{
                this.dropTimer=new ig.Timer(0);
            }
            this.addAnim('idle',1,[0]);
            this.addAnim('selected',1,[1]);
            this.currentAnim=this.anims.idle;
        },
        check:function(other){
            if(other===ig.game.player&&ig.game.player.state==='big'&&this.dropTimer.delta()>0){
                this.sfxPickup.play();
                if(ig.game.selected===this){
                    ig.game.selected=0;
                }
                this.kill();
                ig.game.keys+=1;
            }else if(this.dropTimer.delta()>0){
                ig.game.say('I too small');
            }
        },
        switchSize:function(size){
            if(size==='big'){
                ig.game.spawnEntity(EntityKeyBig,this.pos.x-18,this.pos.y-36,{
                    lastSize:'small'
                });
                this.kill();
            }else if(size==='medium'){
                ig.game.spawnEntity(EntityKeyMedium,this.pos.x-10,this.pos.y-20,{
                    lastSize:'small'
                });
                this.kill();
            }
        }
    });
});

