// lib/game/entities/hearts.js
ig.baked=true;
ig.module('game.entities.hearts').requires('impact.entity').defines(function(){
    EntityHearts=ig.Entity.extend({
        size:{
            x:60,
            y:20
        },
        zIndex:-650,
        gravityFactor:0,
        type:ig.Entity.TYPE.NONE,
        checkAgainst:ig.Entity.TYPE.NONE,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/hearts.png',60,20),
        init:function(x,y,settings){
            this.parent(x,y,settings);
            this.addAnim('full',1,[0]);
            this.addAnim('two',1,[1]);
            this.addAnim('one',1,[2]);
            this.addAnim('empty',1,[3]);
        },
        update:function(){
            this.pos.x=ig.game.screen.x;
            this.pos.y=ig.game.screen.y;
            if(ig.game.player.hp===3){
                this.currentAnim=this.anims.full;
            }else if(ig.game.player.hp===2){
                this.currentAnim=this.anims.two;
            }else if(ig.game.player.hp===1){
                this.currentAnim=this.anims.one;
            }else if(ig.game.player.hp===0){
                this.currentAnim=this.anims.empty;
            }
            this.currentAnim.flip.x=this.flip;
            this.parent();
        }
    });
});

// lib/game/entities/witch.js
ig.baked=true;
ig.module('game.entities.witch').requires('impact.entity').defines(function(){
    EntityWitch=ig.Entity.extend({
        sfxEvilLaugh:new ig.Sound('media/sounds/Evillaugh.*'),
        sfxScream:new ig.Sound('media/sounds/Screampass2.*'),
        size:{
            x:64,
            y:64
        },
        zIndex:-650,
        gravityFactor:0,
        hp:3,
        currentAttack:0,
        type:ig.Entity.TYPE.B,
        checkAgainst:ig.Entity.TYPE.BOTH,
        collides:ig.Entity.COLLIDES.NEVER,
        animSheet:new ig.AnimationSheet('media/witch.png',64,64),
        init:function(x,y,settings){
            this.parent(x,y,settings);
            this.addAnim('idle',0.1,[0,0,0,1,1]);
            this.addAnim('cast',0.1,[2,2,2,3,3]);
            this.addAnim('hit',0.13,[5,6,7,5,8,4]);
            this.addAnim('dies',0.13,[9,10,11,12,13,14,15],true);
            ig.game.witch=this;
            this.castTimer=new ig.Timer(0);
            this.hitTimer=new ig.Timer(0);
            this.attackTimer=new ig.Timer(5);
        },
        cast:function(){
            this.castTimer=new ig.Timer(1);
        },
        damage:function(){
            this.hp-=1;
            this.hitTimer=new ig.Timer(2.5);
            this.sfxScream.play();
            if(this.hp<=0){
                this.dies=true;
                this.dieTimer=new ig.Timer(1);
                this.anims.dies.rewind();
            }
        },
        doNextAttack:function(){
            if(this.currentAttack===0){
                ig.game.spawnFireballs(this.hp);
                this.currentAttack++;
                this.sfxEvilLaugh.play();
            }else if(this.currentAttack===1){
                ig.game.spawnBallLightning(this.hp);
                this.currentAttack++;
                this.sfxEvilLaugh.play();
            }else{
                ig.game.spawnEye();
                this.currentAttack=0;
                this.sfxEvilLaugh.play();
            }
        },
        update:function(){
            if(this.attackTimer.delta()>0){
                this.doNextAttack();
                this.attackTimer=new ig.Timer(10);
            }
            this.currentAnim=this.anims.idle;
            if(this.hitTimer.delta()<0){
                this.currentAnim=this.anims.hit;
            }
            if(this.castTimer.delta()<0){
                this.currentAnim=this.anims.cast;
            }
            if(this.dies&&this.dieTimer.delta()<0){
                this.currentAnim=this.anims.dies;
            }else if(this.dies&&this.dieTimer.delta()>0){
                ig.game.fadeWin();
                this.kill();
            }
            this.currentAnim.flip.x=this.flip;
            this.parent();
        }
    });
});

